import React from "react";
import Logo from "../assets/images/logo.png";
import Helmet from 'react-helmet'

function Index() {
    var coordenadas = { lat: -23.5791213, lng: -46.6658027 };
    var zoomLevel = 12;
    function initialize() {
        var mapOptions = {
            center: coordenadas,
            zoom: 15
        };
        var map = new google.maps.Map(document.getElementById("mapa"), mapOptions);
        locations = buscarEventosProximos()

        setTimeout(() => {
            for (i = 0; i < locations.length; i++) {
                marker = new google.maps.Marker({
                    position: new google.maps.LatLng(locations[i][1], locations[i][2]),
                    title: locations[i][0],
                    map: map
                });
            }
        }, 1000);

    }

    google.maps.event.addDomListener(window, 'load', initialize);

    <script async defer
        src="https://maps.googleapis.com/maps/api/js?key=AIzaSyBvroKF-1rTRd9K-L9P3ILzSCjcFLU1LkQ&callback=initialize">
    </script>

    return (
        <>
            <div id="mapa" onload="buscarEventosProximos()"></div>
        </>
    );
}

export default Index
